INSERT INTO `method_ontologies` (`id`, `methodDbId`, `name`, `class`, `description`, `formula`) VALUES
(1,	'CO_321:0000351',	'AgrScr Estimation',	'Estimation',	'For agronomic score observe visually detectable signs of factors limiting yields and rate.',	NULL),
(2,	'CO_321:0000231',	'Hd DS55 days Computation',	'Computation',	'Number of days required from sowing to spike emergence from the flag leaf (DS55). However, when planting in dry soils in dryland areas it is counted from the first day of rainfall or irrigation which is sufficient for germination, or from emergence date.',	'xxxx'),
(3,	'CO_321:0000232',	'Mat DS87 DT Computation',	'Computation',	'Number of days required from sowing to physiological maturity (approx. DS87). However, when planting in dry soils in dryland areas it is counted from the first day of rainfall or irrigation which is sufficient for germination, or from emergence date.',	'xxxx'),
(4,	'CO_321:0000690',	'Double digit Estimation',	'Estimation',	'The method was improved by using two digits, representing the vertical disease progress and an estimate of severity. The first digit gives the relative height of the disease using the original 0-9 Saari-Prescott scale as a measure. The second digit shows the disease severity as a percentage but in terms of 0-9. Because it is difficult to evaluate diseases on dead leaves, disease notes should be taken when at least four leaves are still alive and green (soft to mid-dough growth stage). Then visually evaluate the average percentage severity on only those leaves of the uppermost four that are infected. In practice, the percent severity is estimated on an overall score. The following format is used for scoring severity: 10% coverage = 1, 20% coverage = 2, 30% coverage = 3, 40% coverage = 4, 50% coverage = 5, 60% coverage = 6, 70% coverage = 7, 80% coverage = 8, 90% coverage = 9. The score of 10 is not used.',	NULL),
(5,	'CO_321:0000386',	'SDS-sedimentation determination',	'Measurement',	'A small sample of flour or ground wheat (1.0 grams) is weighed and placed in 25-milliliter glass-stoppered graduated cylinder. This is mixed with different solutions for some minutes and then rested. Finally, the volume of the sediment is recorded after 21 minutes.',	NULL),
(6,	'CO_321:0000258',	'GrnSpk Computation',	'Computation',	'The number of grains per spike can be measured independently by threshing a known number of randomly selected spikes per plot (10-20 spikes per plot) or can be calculated as: Grains per spike (GSP) = grains m2 / spikes m2.',	'xxxx'),
(7,	'CO_321:0001028',	'GY Computation',	'Computation',	'Use formulae to calculate grain yield in g/m2',	'xxxx'),
(8,	'CO_321:0000355',	'Lodg Estimation',	'Estimation',	'Estimate of the area lodged in the sampled plot.',	NULL),
(9,	'CO_321:0000235',	'GMoi Estimation',	'Estimation',	'Moisture content is determined by drying a grain wheat sample in an air oven and comparing the weight of the sample before and after heating. The amount of weight loss is the moisture content. Moisture content results are expressed as a percentage.',	NULL),
(10,	'CO_321:0001026',	'Rust Coefficient of infection Computation',	'Computation',	'Coefficient of infection (CI) calculated by multiplying the severity times a constant for host response: where immune = 0.0, R=0.2, MR =0.4, MS =0.8, and S=1.0.',	'xxxx'),
(11,	'CO_321:0000241',	'PH Measurement',	'Measurement',	'Measure the length of individual culms from soil surface to the tip of the spike (do not include awn) and record to the nearest centimeter. (Average of 4-10 plants/culms per plot).',	NULL),
(12,	'CO_321:0000398',	'SedIdx Measurement',	'Measurement',	'Standard method for sedimentation index.',	NULL),
(13,	'CO_321:0000277',	'SpkLng Measurement',	'Measurement',	'Measured in centimeters from the base of the spike to the tip excluding the awns (average of 6-10 random spikes in plot).',	NULL),
(14,	'CO_321:0000246',	'GW Measurement',	'Measurement',	'Dry grains at 70oC and weigh.',	NULL);
